DROP PROCEDURE IF EXISTS `kardex_i`$$
CREATE DEFINER=`c1741220`@`%` PROCEDURE `kardex_i` (IN `p_almacen_id` INT, IN `p_producto_id` INT, IN `p_unidad_medida_id` VARCHAR(10), IN `p_cantidad` DECIMAL(20,2), IN `p_fecha_ingreso` VARCHAR(10), IN `p_fecha_vencimiento` VARCHAR(10))  begin
		fecha_ingreso,
		fecha_vencimiento)
	values(p_almacen_id, p_producto_id, p_unidad_medida_id, p_cantidad,
		if(p_fecha_ingreso='', null, str_to_date(p_fecha_ingreso, '%d/%m/%Y')),
		if(p_fecha_vencimiento='', null, str_to_date(p_fecha_vencimiento, '%d/%m/%Y')));
	
	select max(id) as id
	from kardex
	where almacen_id = p_almacen_id and
		producto_id = p_producto_id and
		unidad_medida_id = p_unidad_medida_id and
		cantidad = p_cantidad and
		fecha_ingreso = if(p_fecha_ingreso='', null, str_to_date(p_fecha_ingreso, '%d/%m/%Y'));
END$$

DROP PROCEDURE IF EXISTS `kardex_list_by_almacen`$$
CREATE DEFINER=`c1741220`@`%` PROCEDURE `kardex_list_by_almacen` (IN `p_almacen_id` INT)  begin
 select k.id, k.almacen_id, k.producto_id, k.cantidad,
 k.unidad_medida_id, um.nombre as unidad_medida,
 p.nombre as producto,
 if(k.fecha_ingreso='0000-00-00', '', date_format(k.fecha_ingreso, '%d/%m/%Y')) as fecha_ingreso,
 ifnull(if(k.fecha_vencimiento='0000-00-00', '', date_format(k.fecha_vencimiento, '%d/%m/%Y')), '')as fecha_vencimiento
 from kardex k
 inner join producto p on k.producto_id = p.id
 inner join unidad_medida um on k.unidad_medida_id = um.codigo
 where k.almacen_id = p_almacen_id
 and del = false;
END$$

