DROP PROCEDURE IF EXISTS `persona_rol_list_by_persona_tipo_and_rol_nombre`$$
CREATE DEFINER=`c1741220`@`%` PROCEDURE `persona_rol_list_by_persona_tipo_and_rol_nombre` (IN `p_persona_tipo_id` CHAR(1), IN `p_rol_nombre` VARCHAR(100))  begin
 select p.id,
  p.numero_documento_identidad,
  p.nombre_1,
  p.nombre_2,
  p.nombre_3,
  p.apellido_paterno,
  p.apellido_materno,
  (
		select concat(pd.direccion, ', ', if(pd.referencia = '' or pd.referencia is null, '', concat(pd.referencia, ', ')), upd.name, ', ', upp.name, ', ', updi.name)
		from persona_direccion pd
		inner join ubigeo_peru_departments upd on pd.ubigeo_peru_department_id = upd.id 
		inner join ubigeo_peru_provinces upp on pd.ubigeo_peru_province_id = upp.id and upd.id = upp.department_id 
		inner join ubigeo_peru_districts updi on pd.ubigeo_peru_district_id = updi.id and upp.id = updi.province_id and upd.id = updi.department_id 
		where pd.persona_id = p.id and pd.id = (select max(pd2.id) from persona_direccion pd2 where pd2.persona_id = p.id)
		) as direccion
 from persona_rol pr
 inner join persona p on pr.persona_id = p.id and p.persona_tipo_id = p_persona_tipo_id
 inner join rol r on pr.rol_id = r.id and r.nombre = p_rol_nombre;
END$$

