  cantidad_plan = p_cantidad_plan,
  precio_plan = p_precio_plan,
  cantidad_por_ejecutar = nullif(cantidad_plan, 0.00) - nullif(cantidad_real_acumulada, 0.00),
  precio_por_ejecutar = nullif(precio_plan, 0.00) - nullif(precio_real_acumulado, 0.00),
  fecha_inicio_plan = if(p_fecha_inicio_plan='', null, str_to_date(p_fecha_inicio_plan, '%d/%m/%Y')),
